import React from 'react';
import { Link } from 'react-router-dom';
import logoFile from './logo_white.svg'

const NavLogo = props => {

  const logoStyles = {
    width: "auto", 
    height: "50px", 
    display: "block"
  }

  return(
    <div className="NavLogo">
      <Link
        to="/"
        className="NavLogo__anchor"
        onClick={props.onClick}>
          <Logo 
            className="NavLogo__image"
            style={logoStyles}
          />
      </Link>
    </div>
  )
}

export default NavLogo;
